import React from "react";
import Header from "./Header";
import Bottom from "./Bottom"
const Hero = ({ handleLogout }) => {
  return (
    <section className="hero">
      <nav>
        <Header/>
        <button onClick={handleLogout}>Гарах</button>
      </nav>
      <Bottom/>
      <Subheader/>
      <Product/>
      <Footer/>
    </section>
  );
};
export default Hero;
